spring:
  application:
    name: portal-pacienti-backend
  cloud:
    consul:
      config:
        enabled: false
      discovery:
        ip-address: 127.0.0.1
        catalog-services-watch-delay: 15000
        deregister: false
        fail-fast: false
        prefer-ip-address: true
        heartbeat:
          enabled: true
          reregister-service-on-failure: true
          ttl: 60
        enable-tag-override: true
        scheme: https
  codec:
    max-in-memory-size: 50MB
  jackson:
    serialization:
      write-dates-as-timestamps: false
  rabbitmq:
    username: root
    password: root
  data:
    mongodb:
      authentication-database: licenta
      database: licenta
      password: licenta
      repositories:
        type: reactive
      uri: mongodb://licenta:${spring.data.mongodb.password}@127.0.0.1:27017/licenta
  mail:
    test-connection: true
    host: mail.shield-solutions.com
    port: 587
    username: albert@shield-solutions.com
    password: admin
    properties:
      mail:
        smtp:
          auth: true
          starttls:
            enable: true
          ssl:
            trust: mail.shield-solutions.com
        debug: false
server:
  address: 127.0.0.1
  port: 10000
  compression:
    enabled: true
    mime-types:
      - application/json

logging:
  config: classpath:log4j2.xml

